import React from 'react';
import { FaFacebook, FaFontAwesomeFlag, FaGamepad, FaHome, FaSistrix, FaUsers, FaVideo } from "react-icons/fa";



const Header = () => {
    return (
        <div className="Header">
            <div className="hleft">
            <div className="hleftlogo"><FaFacebook className="hlogo"/></div> 
            <div className="hsearch"><input type="text" placeholder="Search" className="hbar"></input><FaSistrix className="hicon"/></div>
            </div>
            <div className="hcenter">
                <FaHome />
                <FaFontAwesomeFlag />
                <FaVideo />
                <FaUsers />
            </div>
            <div className="hlast">

            </div>
        </div>
    )
}

export default Header;
